import itertools
import re


def findSubstring(s: str, words: list) -> list:

    if not s or not words:
        return []

    concats = set()

    '''for x in itertools.permutations(words):
        if ''.join(x) not in concats:
            concats.add(''.join(x)) 
    '''
    r = [re.finditer(f"(?=({x}))", s) for x in set(''.join(c)
                                                   for c in itertools.permutations(words))]
    return [m.start() for i in r for m in i]


